tables.table_schema:
CREATE TABLE DecisionTreeNodes (
    node_id INT PRIMARY KEY,
    parent_node_id INT,
    node_data JSONB
);

CREATE TABLE DecisionTreeEdges (
    edge_id INT PRIMARY KEY,
    parent_node_id INT,
    child_node_id INT
);

CREATE TABLE DecisionTrees (
    tree_id UUID PRIMARY KEY,
    parent_node_id UUID,
    node_type VARCHAR(50),
    node_value JSON
);

CREATE TABLE TreeEdges (
    edge_id UUID PRIMARY KEY,
    parent_node_id UUID,
    child_node_id UUID
);

CREATE TABLE decision_trees (
    id INT PRIMARY KEY,
    parent_id INT,
    value TEXT
);

CREATE TABLE tree_nodes (
    node_id INT PRIMARY KEY,
    tree_id INT,
    parent_node_id INT,
    node_value TEXT
);

CREATE TABLE tree_links (
    link_id INT PRIMARY KEY,
    node_id INT,
    child_node_id INT
);

CREATE TABLE tree_metadata (
    tree_id INT PRIMARY KEY,
    tree_name TEXT,
    created_at TIMESTAMP
);

CREATE TABLE DecisionTrees (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    parent_id INT,
    FOREIGN KEY (parent_id) REFERENCES DecisionTrees(id)
);

CREATE TABLE Nodes (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    tree_id INT,
    FOREIGN KEY (tree_id) REFERENCES DecisionTrees(id)
);

CREATE TABLE Conditions (
    id INT PRIMARY KEY,
    condition VARCHAR(255)
);

CREATE TABLE Actions (
    id INT PRIMARY KEY,
    action VARCHAR(255)
);

CREATE TABLE Strategies (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    description TEXT
);
